    srInteraction: {
        margin: '20px 40px 0px',
        borderTop: '1px solid #95989A',
        borderBottom: '1px solid #95989A',
        overflow: 'hidden',
        '& .border-right': {
            borderRight: '1px solid #95989A'
        },
        '& .border-left': {
            borderLeft: '1px solid #95989A'
        },
    }
});

export default styles;
